import React from 'react';

function CardList({ cards }) {
    return (
        <div id="search-results" style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
            {cards.map((card, index) => (
                <div key={index} style={{ margin: '10px', border: '1px solid #ccc', borderRadius: '8px', padding: '16px', textAlign: 'center' }}>
                    {/* Ensure you are using the correct property name 'image_url' from your API response */}
                    {card.image_url && <img src={card.image_url} alt={card.name} style={{ maxWidth: '100%', borderRadius: '4px' }} />}
                    <p>{card.name}</p>
                    <p>{card.mana_cost || 'No mana cost'}</p> {/* Handle potential null values for mana_cost */}
                </div>
            ))}
        </div>
    );
}

export default CardList;
